Male terminalia
. Apex of ventral median lobe rounded; ventral lobe slightly longer than or as long as dorsal lobe; internal sac with dense long simple spines almost throughout except short basal and terminal areas (
Fig. 74a
). Eighth sternite obliquely truncate, side sharply pointed and apex heavily emarginated, with dense long setae; ventral surface with sparse simple spines and cloud-like processes (
Fig. 74b
). Eighth tergite round at sides and rounded or slightly truncate at apex, with fairly dense basally-forked spines on dorsal surface (
Fig. 74c
). Paramere long, 2.8–2.9 × as long as wide, cylindrical in shape, apex rounded with long and short setae (
Fig. 74d
).

Ovipositor and spermatheca.
Ovipositor relatively long; styli arising terminally with short hairs (
Fig. 74e
). Spermatheca relatively short and robust, moderately curved; spermathecal gland arising at base (
Fig. 74f
).

Known hosts are Brigalow (

Acacia harpophylla

). Adults were attracted to MV light and were collected during May to December, and February to March.
